import{o as e,c as t,a as s}from"./app.88357bea.js";const a='{"title":"La ressource qui permet de se connecter est détaillée comme suit:","description":"","frontmatter":{},"headers":[{"level":3,"title":"La ressource qui permet de se connecter est détaillée comme suit:","slug":"la-ressource-qui-permet-de-se-connecter-est-detaillee-comme-suit"}],"relativePath":"guide/auth/login.md","lastUpdated":1626371033561}',r={},n=s('<meta charset="utf-8"><h3 id="la-ressource-qui-permet-de-se-connecter-est-detaillee-comme-suit"><a class="header-anchor" href="#la-ressource-qui-permet-de-se-connecter-est-detaillee-comme-suit" aria-hidden="true">#</a> La ressource qui permet de se connecter est détaillée comme suit:</h3><br><br><h4 id="_1-resource-description"><a class="header-anchor" href="#_1-resource-description" aria-hidden="true">#</a> 1. Resource description</h4><p>Cette ressource permet de se connecter via un compte d&#39;utilisateur déjà créé.</p><h4 id="_2-s-enregsitrer"><a class="header-anchor" href="#_2-s-enregsitrer" aria-hidden="true">#</a> 2. S&#39;enregsitrer</h4><p>Pour acceder à cette ressource, vous faites appel à l&#39;url suivante:</p><div class="language-"><pre><code>url: /login\n</code></pre></div><div class="danger custom-block"><p class="custom-block-title">Rappel</p><p>En utilisant la methode <code>POST</code></p></div><br><h4 id="_3-parametres"><a class="header-anchor" href="#_3-parametres" aria-hidden="true">#</a> 3. Paramètres</h4><p>Les diiferents parametres liées à cette ressource sont les suivants:</p><table><thead><tr><th>paramettre</th><th style="text-align:center;">Type</th><th>regle de validation</th><th style="text-align:right;">Description</th></tr></thead><tbody><tr><td>username</td><td style="text-align:center;">alphanumeric</td><td>???</td><td style="text-align:right;">C&#39;est le nom qui sera utilisé dans l&#39;authetification</td></tr><tr><td>password</td><td style="text-align:center;">alphanumeric</td><td>???</td><td style="text-align:right;">le mot de passe</td></tr></tbody></table><br><h4 id="_4-requete-reussie"><a class="header-anchor" href="#_4-requete-reussie" aria-hidden="true">#</a> 4. Requête réussie</h4><p>Ci-dessous un exemple de rêquete passée avec succès :</p><div class="language-json"><pre><code><span class="token punctuation">{</span>\n  <span class="token property">&quot;token&quot;</span><span class="token operator">:</span> <span class="token string">&quot;eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiJ9.eyJpYXQiOjE2MjQ1NDg2MjUsImV4cCI6MTYyNTU0ODYyNCwicm9s........y5a-Cw&quot;</span>\n<span class="token punctuation">}</span>\n</code></pre></div><h4 id="_5-cas-d-echec-d-une-requete"><a class="header-anchor" href="#_5-cas-d-echec-d-une-requete" aria-hidden="true">#</a> 5. Cas d&#39;échec d&#39;une requête</h4><p>Lorsque le nom d&#39;utilisateur ou le mot de passe est incorrect, il s&#39;affiche le message suivant:</p><div class="language-json"><pre><code><span class="token punctuation">{</span>\n  <span class="token property">&quot;code&quot;</span><span class="token operator">:</span> <span class="token number">401</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;message&quot;</span><span class="token operator">:</span> <span class="token string">&quot;Invalid credentials.&quot;</span>\n<span class="token punctuation">}</span>\n</code></pre></div>',21);r.render=function(s,a,r,i,c,o){return e(),t("div",null,[n])};export default r;export{a as __pageData};
